INSERT INTO `curso` (`Curso_ID`, `Curso_Activo`, `curso_origen`, `Curso_DescripcionCategoriatematica`, `Curso_AreaConocimiento`, `Curso_PropositoFormacion`, `Curso_TipoContenido`, `Curso_Tipoart`, `Curso_Tituloart`, `Curso_Contenidocurso`, `Curso_Descripcion`, `Curso_FechaCreacion`, `Curso_Idioma`, `Curso_Costo`, `Curso_Proovedor`, `Curso_Responsable`, `Curso_Duracion`, `Curso_HorasCredito`) VALUES
('CLS_SA_005_0028', 'Y', 'Coursera', 'TI', 'Analitycs', 'Conocimiento', 'Enlace', 'VIRTUAL', NULL, 'Comprender los conceptos b sicos de las declaraciones SELECT\n\nComprenda c¢mo y por qu‚ filtrar resultados\n\nExplore la agrupaci¢n y agregaci¢n para responder preguntas anal¡ticas\n\nTrabajar con resultados de clasificaci¢n y limitaci¢n.', 'En este curso, obtendr  una mirada en profundidad a la instrucci¢n SELECT de SQL y sus cl usulas principales. El curso se enfoca en los motores de Big Data SQL Apache Hive y Apache Impala, pero la mayor parte de la informaci¢n tambi‚n es aplicable a SQL con RDBM tradicionales; El instructor aborda expl¡citamente las diferencias para MySQL y PostgreSQL.', '25 jun. 2020', 'espanol', '0', NULL, 'Andres Perez', '18', '0'),
('COURSERA_18004', 'Y', 'Coursera', 'TI', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'In this course, you will: a) Explore image classification, image segmentation, object localization, and object detection. Apply transfer learning to object localization and detection. b) Apply object detection models such as regional-CNN and ResNet-50, customize existing models, and build your own models to detect, localize, and label your own rubber duck images. c) Implement image segmentation using variations of the fully convolutional network (FCN) including U-Net and d) Mask-RCNN to identify and detect numbers, pets, zombies, and more. d) Identify which parts of an image are being used by your model to make its predictions using class activation maps and saliency maps and apply these ML interpretation methods to inspect and improve the design of a famous network, AlexNet. The DeepLearning.AI TensorFlow: Advanced Techniques Specialization introduces the features of TensorFlow that provide learners with more control over their model architecture and tools that help them create and train advanced ML models. This Specialization is for early and mid-career software and machine learning engineers with a foundational understanding of TensorFlow who are looking to expand their knowledge and skill set by learning advanced TensorFlow features to build powerful models.', '6 may. 2021', 'espanol', '0', NULL, '0', '0', '0'),
('COURSERA_18005', 'Y', 'Coursera', 'Liderazgo y Gerencia', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'This course teaches you the simple principles expert managers use to improve and motivate employee performance. You?ll never have to avoid telling an employee ?the truth? again, because the seven techniques we teach will not make employees defensive or afraid. As a manager, or someone who would like to be a manager, you?ll also learn specifically what feedback is, how negative feedback is weighed more heavily than positive, and how positive feedback can super-charge behaviors such as creativity and teamwork. Giving feedback is a skill which develops over time. We give you a process you can use to improve your feedback skills and deliver it with confidence. You will find that there is a scientific basis for many of your observations and intuitions about feedback?such as, it is hard to give correctly, people don?t like it, and more. This will be reassuring as you learn how to overcome these difficulties. We hope you have a fantastic time becoming a better manager!', '6 may. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_18006', 'Y', 'Coursera', 'TI', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'Accounting has always been about analytical thinking. From the earliest days of the profession, Luca Pacioli emphasized the importance of math and order for analyzing business transactions. The skillset that accountants have needed to perform math and to keep order has evolved from pencil and paper, to typewriters and calculators, then to spreadsheets and accounting software. A new skillset that is becoming more important for nearly every aspect of business is that of big data analytics: analyzing large amounts of data to find actionable insights. This course is designed to help accounting students develop an analytical mindset and prepare them to use data analytic programming languages like Python and R. We?ve divided the course into three main sections. In the first section, we bridge accountancy to analytics. We identify how tasks in the five major subdomains of accounting (i.e., financial, managerial, audit, tax, and systems) have historically required an analytical mindset, and we then explore how those tasks can be completed more effectively and efficiently by using big data analytics. We then present a FACT framework for guiding big data analytics: Frame a question, Assemble data, Calculate the data, and Tell others about the results. In the second section of the course, we emphasize the importance of assembling data. Using financial statement data, we explain desirable characteristics of both data and datasets that will lead to effective calculations and visualizations. In the third, and largest section of the course, we demonstrate and explore how Excel and Tableau can be used to analyze big data. We describe visual perception principles and then apply those principles to create effective visualizations. We then examine fundamental data analytic tools, such as regression, linear programming (using Excel Solver), and clustering in the context of point of sale data and loan data. We conclude by demonstrating the power of data analytic programming languages to assemble, visualize, and analyze data. We introduce Visual Basic for Applications as an example of a programming language, and the Visual Basic Editor as an example of an integrated development environment (IDE).', '6 may. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_18009', 'Y', 'Coursera', 'Corporativa', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'Welcome to Course 2 - Sales Strategy - This course is designed to discuss the application of intelligence analysis in the sales planning process. And this approach contributes to integrating the sales planning process into the corporate strategy of the company because, in the strategy analysis and formulation process, we apply models, frameworks, tools, and techniques that also apply to the sales planning and management process. Therefore, the expected outcomes of this course focus on the transition from traditional to strategic sales planning, by discussing and applying the concepts recommended to support the development of the strategic guidelines. The concepts, models, tools, and techniques discussed and practiced during the course focus on the improvement of value creation from the sales function empowered by intelligence analysis, a process which typically applies in the strategy analysis front. The discussions go through how intelligence analysis can support the sales function, by providing methods to connect strategy to marketing and sales planning processes. In this course, the primary learning outcome is the ability to apply intelligence analysis to support sales planning process, and by being able to do this, you?ll improve your competencies and skills to support sales planning with a strategic approach. You?ll develop a final assignment at the end of the course, and it is designed from an adapted real-life business case. The challenges of the case comprise the business context, through which you?ll apply the conceptual framework discussed during Course 2. The outcomes of your analysis on the assignment case will be evaluated through a peer-review process.', '6 may. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_18010', 'Y', 'Coursera', 'TI', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'In this first course of this specialization, you will discover what data visualization is, and how we can use it to better see and understand data. Using Tableau, we?ll examine the fundamental concepts of data visualization and explore the Tableau interface, identifying and applying the various tools Tableau has to offer. By the end of the course you will be able to prepare and import data into Tableau and explain the relationship between data analytics and data visualization. This course is designed for the learner who has never used Tableau before, or who may need a refresher or want to explore Tableau in more depth. No prior technical or analytical background is required. The course will guide you through the steps necessary to create your first visualization from the beginning based on data context, setting the stage for you to advance to the next course in the Specialization.', '6 may. 2021', 'espanol', '0', NULL, '0', '0', '0'),
('COURSERA_18011', 'Y', 'Coursera', 'Cadena de abastecimiento', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'Have you ever wondered how goods get delivered to us so quickly as soon as we order them? One word: Logistics! In this introductory Supply Chain Logistics course, I will take you on a journey to this fascinating backbone of global trade. We cover the three major building blocks of logistics networks: transportation, warehousing, and inventory. After completing this course, you will be able to differentiate the advantages and disadvantages of different modes of transportation. You will understand what goes into designing and setting up a warehousing facility. Finally, you will be able to select the options that enable you to develop logistics networks, that minimize costs and deliver top customer service. This is an introductory course designed to provide you with a start on your learning journey in logistics. You do not need to have any background in logistics, but it would be beneficial if you had a basic understanding of business concepts. Join me and we will learn together about logistics! Interested in learning advanced supply chain topics? Check out the Supply Chain Excellence MasterTrack? Certificate: https://www.coursera.org/mastertrack/supply-chain-excellence-rutgers', '6 may. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_18013', 'Y', 'Coursera', 'Liderazgo y Gerencia', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'You will be able to gain and apply your knowledge and understanding of personal and professional awareness, organization and commitment, and use the tools, methods and techniques that you have learned in goal setting, prioritization, scheduling, and delegation to overcome time management challenges and enhance productivity. Upon completing this course, you will be able to: 1. Learn to plan effectively to achieve your personal and professional goals 2. Learn to recognize and overcome barriers to successful time management 3. Identify specific time management tools and use them effectively 4. Manage resources both effectively and efficiently 5. Keep your sense of perspective to prevent and manage crises 6. Learn to delegate effectively 7. Learn to manage expectations and say ?No? when appropriate', '6 may. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_19002', 'Y', 'Coursera', 'Liderazgo y Gerencia', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'In this foundational course, you will be challenged to develop as a leader. You will explore the concept of leadership, assess required competencies for today\'s leaders, learn more about yourself and how you can make effective and ethical decisions, identify how to build trusting relationships with others, and articulate a practice for growing as a leader. This course is part of Gies College of Business? suite of online programs, including the iMBA, iMSA and iMSM. Learn more about admission into these programs and explore how your Coursera work can be leveraged if accepted into a degree program at https://degrees.giesbusiness.illinois.edu/idegrees/.', '2 jun. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_19007', 'Y', 'Coursera', 'Liderazgo y Gerencia', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'One way or another, all employees are managed. But approaches to managing employees varying from employee-to-employee, job-to-job, manager-to-manager, organization-to-organization, and country-to-country. This course provides a foundation for developing your own approach to skillfully managing employees by illustrating alternative human resource management (HRM) strategies, introducing the importance of the legal context, and thinking about what motivates employees. This will then give you the factual and conceptual basis for developing specific, critical HRM skills in subsequent courses on hiring employees, managing performance, and rewarding employees. Don\'t know anything about HRM? That\'s OK! Leave this course with a new-found understanding of the range of options available for managing employees, a grasp of what makes workers tick, and the readiness to develop your own HRM skills.', '2 jun. 2021', 'frances', '0', NULL, '0', '0', '0'),
('COURSERA_19008', 'Y', 'Coursera', 'Liderazgo y Gerencia', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'In this course, you will learn the neuroscience of change, why we are so change-averse, how to train for change resilience, and most importantly, you will begin developing a practice to help you be prepared for changes in personal life and in your career. You will learn specific strategies and tools for overcoming fear, anxiety and managing stress related to these changes. By the end of this course, you will know what you need to do to become truly unshakable. You will build a practice for getting stronger emotionally and mentally. By understanding neuroscience and building awareness of yourself, you will build a solid foundation for understanding your team and the greater behavior of the business world. Remember, these changes won?t happen if you don?t take action. You might be uncomfortable, you might find some of the exercises silly, you might have doubts, and you might want to quit. Babies don?t quit trying to walk because they fall a lot, and neither should you. The only way to truly change is to practice consistently.', '2 jun. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_20002', 'Y', 'Coursera', 'Corporativa', 'Modelo de procesos', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'Thinking and doing the same things faster and better is not enough for innovation; we need creativity. Fortunately, creativity is a skill you can learn. This course will examine when, why, and how you can be creative so you can go through the creative process more efficiently and effectively. It teaches concrete steps to enable you to change your perspective to see new possibilities and solutions. It clarifies what to expect from the creative process and provides support for how you can sustain your progress. It also provides guidance on leading a supportive culture for creativity. The result is an ability to increase your own creativity and that of your teams and organizations so as to recognize and develop new opportunities. You will be able to: - Identify and generate opportunities to be creative and launch the innovation process - Intentionally and confidently enter and proceed through the creative process - Foster and sustain the creativity of others This course is part of Gies College of Business? suite of online programs, including the iMBA and iMSM. Learn more about admission into these programs and explore how your Coursera work can be leveraged if accepted into a degree program at https://degrees.giesbusiness.illinois.edu/idegrees/.', '2 jul. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_20004', 'Y', 'Coursera', 'Cadena de abastecimiento', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'This course will provide a solid understanding of what a supply chain is all about. The course: - Provides an introduction to Supply Chain - Leverages graphics to promote the Integrated Supply Chain model - Emphasizes understanding the Extended Supply Chain - Presents a holistic approach ? Incorporating People, Process, and Technology - Calls-out industry-specific supply chain - Leverages discussions, videos, quizzes, and questions for consideration - Provides awareness of career path opportunities - Presents emerging and futuristic trends in supply chain and given that at GT we are focused on developing what?s next in the world, we include Discussion of emerging and futuristic trends in supply chain. There is very little math involved in this course ? so don?t worry at all about your math skills. The course incorporates reading materials that were developed as part of a $24.5M TAACCCT grant awarded by the U.S. Department of Labor?s Employment and Training Administration to the LINCS in Supply Chain Management consortium.', '2 jul. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_20005', 'Y', 'Coursera', 'TI', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'If there is a shortcut to becoming a Data Scientist, then learning to think and work like a successful Data Scientist is it. Most of the established data scientists follow a similar methodology for solving Data Science problems. In this course you will learn and then apply this methodology that can be used to tackle any Data Science scenario. The purpose of this course is to share a methodology that can be used within data science, to ensure that the data used in problem solving is relevant and properly manipulated to address the question at hand. Accordingly, in this course, you will learn: - The major steps involved in practicing data science - Forming a business/research problem, collecting, preparing & analyzing data, building a model, deploying a model and understanding the importance of feedback - Apply the 6 stages of the CRISP-DM methodology, the most popular methodology for Data Science and Data Mining problems - How data scientists think! To apply the methodology, you will work on a real-world inspired scenario and work with Jupyter Notebooks using Python to develop hands-on experience.', '2 jul. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_20008', 'Y', 'Coursera', 'Corporativa', 'Proyectos', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'This course combines the essential elements of Project Management and Team Leadership into one course. Through class engagement and reflection, you will acquire further understanding of the responsibilities of leadership and become better prepared to apply this knowledge to the project environment. Upon completing this course, you will be able to: 1. Learn about the role of high performance teams and leadership in project management 2. Learn about the tools and techniques for developing and strengthening high performance teams and team members 3. Learn about the stages in project cycle 4. Apply best practices to develop competencies and skills in planning and controlling projects to ensure successful outcomes 5. Learn how to monitor project activities and assess progress 6. Learn to communicate proficiently to report project status and performance to stakeholders and contribute to organizational knowledge base', '2 jul. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_20009', 'Y', 'Coursera', 'Liderazgo y Gerencia', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'This is a foundational course in the Agile Leadership Specialization. By the end of this course, you will build an understanding of key agile leadership concepts. You will begin building a toolbox that will give you an ability to evaluate and create a baseline for yourself as an agile leader. You will access your team?s readiness for change. You will also analyze to what degree an organization is agile, and evaluate its ability to respond to change triggers.', '2 jul. 2021', 'espanol', '0', NULL, '0', '0', '0'),
('COURSERA_21001', 'Y', 'Coursera', 'Summarte', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'Your smartphone, smartwatch, and automobile (if it is a newer model) have AI (Artificial Intelligence) inside serving you every day. In the near future, more advanced ?self-learning? capable DL (Deep Learning) and ML (Machine Learning) technology will be used in almost every aspect of your business and industry. So now is the right time to learn what DL and ML is and how to use it in advantage of your company. This course has three parts, where the first part focuses on DL and ML technology based future business strategy including details on new state-of-the-art products/services and open source DL software, which are the future enablers. The second part focuses on the core technologies of DL and ML systems, which include NN (Neural Network), CNN (Convolutional NN), and RNN (Recurrent NN) systems. The third part focuses on four TensorFlow Playground projects, where experience on designing DL NNs can be gained using an easy and fun yet very powerful application called the TensorFlow Playground. This course was designed to help you build business strategies and enable you to conduct technical planning on new DL and ML services and products.', '14 jul. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_21002', 'Y', 'Coursera', 'Liderazgo y Gerencia', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'Now that you have undergone personal information, you will be better prepared to empathize, understand, and mentor individual members of your team on a similar journey. Leading teams towards change-resilience is not as simple as knowing and understanding the psychology of individuals multiplied by a number of team members. It requires a different approach. In this course, you will learn what influences human behavior in teams by looking at social psychology. You will evaluate your team?s level of change resilience and agility, and you will be applying practical tools for building Agile teams by applying Scrum project management framework. You won?t stop there, you will learn how to be a servant leader. You will learn practical tools for organizing, leading, and facilitating a Scrum team. Parts of the content are written from a Scrum Master perspective, and even though you will not be able to use it as a Scrum Master certification, I will be sharing tools and best practices learned through my own experience of being a Scrum Master.', '3 ago. 2021', 'frances', '0', NULL, '0', '0', '0'),
('COURSERA_23002', 'Y', 'Coursera', 'TI', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'This course presents a gentle introduction into the concepts of data analysis, the role of a Data Analyst, and the tools that are used to perform daily functions. You will gain an understanding of the data ecosystem and the fundamentals of data analysis, such as data gathering or data mining. You will then learn the soft skills that are required to effectively communicate your data to stakeholders, and how mastering these skills can give you the option to become a data driven decision maker. This course will help you to differentiate between the roles of a Data Analyst, Data Scientist, and Data Engineer. You will learn the responsibilities of a Data Analyst and exactly what data analysis entails. You will be able to summarize the data ecosystem, such as databases and data warehouses. You will then uncover the major vendors within the data ecosystem and explore the various tools on-premise and in the cloud. Continue this exciting journey and discover Big Data platforms such as Hadoop, Hive, and Spark. By the end of this course you will be able to visualize the daily life of a Data Analyst, understand the different career paths that are available for data analytics, and identify the many resources available for mastering this profession. Throughout this course you will learn the key aspects to data analysis. You will begin to explore the fundamentals of gathering data, and learning how to identify your data sources. You will then learn how to clean, analyze, and share your data with the use of visualizations and dashboard tools. This all comes together in the final project where it will test your knowledge of the course material, explore what it means to be a Data Analyst, and provide a real-world scenario of data analysis. This course does not require any prior data analysis, spreadsheet, or computer science experience. All you need to get started is basic computer literacy, high school level math, and access to a modern web browser such as Chrome or Firefox.', '2 sept. 2021', 'espanol', '0', NULL, '0', '0', '0'),
('COURSERA_23004', 'Y', 'Coursera', 'Liderazgo y Gerencia', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'This course will improve your ability to influence people in situations where you cannot use formal authority. You will learn about effective ways to build, develop, and sustain a power base in your organization. You will also learn influence tactics that enable you to be more persuasive and influential in working with your superiors, peers, and even subordinates. In addition, you will learn how to build and maintain high-quality relationships to further maximize your informal power and ability to influence others. Importantly, you will distinguish between influence and manipulation and learn how to protect yourself from the unwanted influence of others. The influence strategies you learn in this course will make you a more confident and influential leader, presenter, and decision-maker. You will more effective in pitching business ideas to your superiors, influencing customers, and building coalitions across stakeholders. This course will not only give you strategic guidance on how to develop and maintain your network for influence and power, but we will also equip you with specific tactics and strategies that are proven to work for gaining power and influencing people.', '2 sept. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_23006', 'Y', 'Coursera', 'TI', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'In the first course of Machine Learning Engineering for Production Specialization, you will identify the various components and design an ML production system end-to-end: project scoping, data needs, modeling strategies, and deployment constraints and requirements; and learn how to establish a model baseline, address concept drift, and prototype the process for developing, deploying, and continuously improving a productionized ML application. Understanding machine learning and deep learning concepts is essential, but if you?re looking to build an effective AI career, you need production engineering capabilities as well. Machine learning engineering for production combines the foundational concepts of machine learning with the functional expertise of modern software development and engineering roles to help you develop production-ready skills. Week 1: Overview of the ML Lifecycle and Deployment Week 2: Selecting and Training a Model Week 3: Data Definition and Baseline', '2 sept. 2021', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_27004', 'Y', 'Coursera', 'TI', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'Machine Learning, often called Artificial Intelligence or AI, is one of the most exciting areas of technology at the moment. We see daily news stories that herald new breakthroughs in facial recognition technology, self driving cars or computers that can have a conversation just like a real person. Machine Learning technology is set to revolutionise almost any area of human life and work, and so will affect all our lives, and so you are likely to want to find out more about it. Machine Learning has a reputation for being one of the most complex areas of computer science, requiring advanced mathematics and engineering skills to understand it. While it is true that working as a Machine Learning engineer does involve a lot of mathematics and programming, we believe that anyone can understand the basic concepts of Machine Learning, and given the importance of this technology, everyone should. The big AI breakthroughs sound like science fiction, but they come down to a simple idea: the use of data to train statistical algorithms. In this course you will learn to understand the basic idea of machine learning, even if you don\'t have any background in math or programming. Not only that, you will get hands on and use user friendly tools developed at Goldsmiths, University of London to actually do a machine learning project: training a computer to recognise images. This course is for a lot of different people. It could be a good first step into a technical career in Machine Learning, after all it is always better to start with the high level concepts before the technical details, but it is also great if your role is non-technical. You might be a manager or other non-technical role in a company that is considering using Machine Learning. You really need to understand this technology, and this course is a great place to get that understanding. Or you might just be following the news reports about AI and interested in finding out more about the hottest new technology of the moment. Whoever you are, we are looking forward to guiding you through you first machine learning project. NB this course is designed to introduce you to Machine Learning without needing any programming. That means that we don\'t cover the programming based machine learning tools like python and TensorFlow.', '5 ene. 2022', 'espanol', '0', NULL, '0', '0', '0'),
('COURSERA_27005', 'Y', 'Coursera', 'TI', '0', '0', 'Registro de horas', 'VIRTUAL', NULL, '0', 'Working knowledge of SQL (or Structured Query Language) is a must for data professionals like Data Scientists, Data Analysts and Data Engineers. Much of the world\'s data resides in databases. SQL is a powerful language used for communicating with and extracting data from databases. In this course you will learn SQL inside out- from the very basics of Select statements to advanced concepts like JOINs. You will: -write foundational SQL statements like: SELECT, INSERT, UPDATE, and DELETE -filter result sets, use WHERE, COUNT, DISTINCT, and LIMIT clauses -differentiate between DML & DDL -CREATE, ALTER, DROP and load tables -use string patterns and ranges; ORDER and GROUP result sets, and built-in database functions -build sub-queries and query data from multiple tables -access databases as a data scientist using Jupyter notebooks with SQL and Python -work with advanced concepts like Stored Procedures, Views, ACID Transactions, Inner & Outer JOINs Through hands-on labs and projects, you will practice building SQL queries, work with real databases on the Cloud, and use real data science tools. In the final project you?ll analyze multiple real-world datasets to demonstrate your skills.', '5 ene. 2022', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_27006', 'Y', 'Coursera', 'Corporativa', '0', '0', 'Registro de horas', 'VIRTUAL', NULL, '0', 'This course is designed to help Scrum beginners learn the foundational knowledge to become proficient with Agile Scrum. Throughout the course, learners will explore User Stories and how they are prioritized in Agile, Velocity, Backlog Refinement, and Market Actions. Learners will also learn about different Scrum Reports and methods of managing risks.', '5 ene. 2022', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_27008', 'Y', 'Coursera', 'Corporativa', '0', '0', 'Registro de horas', 'VIRTUAL', NULL, '0', 'This course is designed to help Scrum beginners learn the foundational knowledge to become proficient with Agile Scrum. Throughout the course, learners will explore Agile methodologies and benefits of building incrementally. They will also learn about the roles within Scrum teams, events that happen during a Sprint, Agile artifacts, and the Definition of Done for a Sprint.', '5 ene. 2022', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_27009', 'Y', 'Coursera', 'TI', '0', '0', 'Registro de horas', 'VIRTUAL', NULL, '0', 'Not so long ago, the job of product manager was about assessing market data, creating requirements, and managing the hand-off to sales/marketing. Maybe you?d talk to a customer somewhere in there and they?d tell you what features they wanted. But companies that manage product that way are dying. Being a product person today is a new game, and product managers are at the center of it. Today, particularly if your product is mostly digital, you might update it several times a day. Massive troves of data are available for making decisions and, at the same time, deep insights into customer motivation and experience are more important than ever. The job of the modern product manager is to charter a direction and create a successful working environment for all the actors involved in product success. It?s not a simple job or an easy job, but it is a meaningful job where you?ll be learning all the time. This course will help you along your learning journey and prepare you with the skills and perspective you need to: Create the actionable focus to successfully manage your product (week 1) Focus your work using modern product management methods (week 2) Manage new products and explore new product ideas (week 3) Manage and amplify existing products (week 4) This course is ideal for current product or general managers interested in today\'s modern product management methods. Please note that there are new additions to this course and subtitles for these videos will soon be available. This course was developed with the generous support of the Batten Institute at UVA?s Darden School of Business. The Batten Institute?s mission is to improve the world through entrepreneurship and innovation: www.batteninstitute.org.', '5 ene. 2022', 'espanol', '0', NULL, '0', '0', '0'),
('COURSERA_30001', 'Y', 'Coursera', 'TI', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'We all love stories, so why don\'t we use more of them at work? In this project we will help you learn some tools of good storytelling and create one for a freely available data set from KIVA, the microloan organization.', '2 jun. 2022', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_30005', 'Y', 'Coursera', 'Liderazgo y Gerencia', '0', '0', 'Registro de horas', 'VIRTUAL', NULL, '0', 'To survive in today?s constantly changing business landscape requires being comfortable in uncertainty. Adaptability is what allows people and businesses to solve problems, overcome challenges and move back from the edge of attrition to the more stable ground of relevance. Adaptability is everything. ? Jeff Boss, Forbes Adaptability refers to your ability change your actions, course, or approach in order to suit different conditions or environments. Adaptability implies a sense of personal choice, of purposefully navigating?rather than being driven by?changing circumstances. Resilience is the capacity to recover quickly from difficulties. Resilience gives you the ability to bounce forward with new insights and learning you can carry into the future. Both adaptability and resilience include the ability to assess an evolving situation from multiple perspectives, to shift thinking and viewpoint, and to choose the best response. Adaptable people flourish amidst chaos while inflexible people flounder. Adapters find openings in situations where others only see closure. This 4-module course will give you knowledge and tools to become more adaptable and resilient in your workplace and in your life.', '2 jun. 2022', 'frances', '0', NULL, '0', '0', '0'),
('COURSERA_46002', 'Y', 'Coursera', 'TI', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'By the end of this project, you will learn how to use Sketch Up for web to model simple 3D objects 3D modeling is largely used in the design fields, to represent interiors, products, games. In 3D computer graphics, 3D modeling is meant as the process of developing a mathematical representation of any surface of an object in three dimensions via modeling software. The product of this process is called a 3D model. This model can also be displayed as a two-dimensional image through a process called 3D rendering or used in computer simulations. Nowadays thanks to the use of 3D printers modelers are able to physically create the 3D model. SketchUp for Web is a free version of SketchUp that runs in a web browser. It shows a simple interface where anyone can simply draw and create 3D models. This makes 3D modeling accessible and easy to use to anyone interested in exploring this field. This guided project is for students, graphic designers, illustrators, or artists who want to explore SketchUp for Web as a free tool to try 3D modeling. Anyone interested in exploring 3D modeling.', '2 dic. 2022', 'holandes', '0', NULL, '0', '0', '0'),
('COURSERA_46003', 'Y', 'Coursera', 'Corporativa', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'This course is the first in a series of six to equip you with the skills you need to apply to introductory-level roles in project management. Project managers play a key role in leading, planning and implementing critical projects to help their organizations succeed. In this course, you?ll discover foundational project management terminology and gain a deeper understanding of the role and responsibilities of a project manager. We?ll also introduce you to the kinds of jobs you might pursue after completing this program. Throughout the program, you?ll learn from current Google project managers, who can provide you with a multi-dimensional educational experience that will help you build your skills for on-the-job application. Learners who complete this program should be equipped to apply for introductory-level jobs as project managers. No previous experience is necessary. By the end of this course, you will be able to: - Define project management and describe what constitutes a project. - Explore project management roles and responsibilities across a variety of industries. - Detail the core skills that help a project manager be successful. - Describe the life cycle of a project and explain the significance of each phase. - Compare different program management methodologies and approaches and determine which is most effective for a given project. - Define organizational structure and culture and explain how it impacts project management. - Define change management and describe the role of the project manager in the process.', '2 dic. 2022', 'Ingl‚s', '0', NULL, '0', '0', '0'),
('COURSERA_46004', 'Y', 'Coursera', 'Corporativa', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'Strategic Organization Design will introduce new topics and modules with even more real world examples and opportunities for student interaction than its predecessors Competitive Strategy (https://www.coursera.org/learn/competitive-strategy) and Advanced Competitive Strategy (https://www.coursera.org/learn/advanced-competitive-strategy). The final course in the Competitive Strategy and Organization Design specialization covers the internal workings of an organization and its interactions with the outside world. Where the first two courses mainly covered the way firms interact with the outside world, in particular competitors and complementors, the third course looks at the way a firm?s organization should be designed to compete effectively.', '2 dic. 2022', 'Ingl‚s', '0', NULL, '0', '14', '0'),
('COURSERA_46006', 'Y', 'Coursera', 'TI', '0', '0', 'Enlace', 'VIRTUAL', NULL, '0', 'In this course, you will learn how Azure Functions enable the creation of event-driven, compute-on-demand systems that can be triggered by various external events. You will earn how to leverage functions to execute server-side logic and build serverless architectures. This course will help you prepare for the Microsoft Certified: Azure Developer Associate certification. This course is part of a Specialization intended for developers who want to demonstrate their expertise in all phases of cloud development from requirements, definition, and design; to development, deployment, and maintenance; to performance tuning and monitoring. It is ideal for anyone interested in preparing for the AZ-204: Developing Solutions for Microsoft Azure exam. This is the first course in a program of 8 courses to help prepare you to take the exam. Each course teaches you the concepts and skills that are measured by the exam. By the end of this Professional Certificate program, you will be ready to take and sign-up for the Exam AZ-204: Developing Solutions for Microsoft Azure.', '2 dic. 2022', 'espanol', '0', NULL, '0', '18', '0');
